import ExpenseItem from "./components/ExpenseItem";

function App() {

  const ex='finish!!';

  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    }
  ];


  return (
    <div>
      <h2>Let's get started!</h2>
      {/* <p>this is visible too!!</p> */}
      {ex}
      <ExpenseItem 
      name={expenses[0].title} 
      amnt={expenses[0].amount}
      ></ExpenseItem>
      <ExpenseItem 
      name={expenses[1].title} 
      amnt={expenses[1].amount}
      ></ExpenseItem>
      <ExpenseItem 
      name={expenses[2].title} 
      amnt={expenses[2].amount}
      ></ExpenseItem>
      <ExpenseItem 
      name={expenses[3].title} 
      amt={expenses[3].amount}
      ></ExpenseItem>

    </div>
  );
}

export default App;
